import React, { useState } from "react";
import "./FormEspecifications.css";

const AddNew = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const addExpenseHandler = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <button onClick={addExpenseHandler}>Add New Expense</button>
    </div>
  );
};

export default AddNew;
